import { Component } from 'react';
import {
  Text,
  View,
  StyleSheet,
  Button,
} from 'react-native';


export default function App(props:any) {







    return ( <View style = {
        {
          flex: 1,
          flexDirection: 'column',
          justifyContent:"center"
        }
      }>


<Button
        title="Scan"
        onPress={() => {
            console.log(this.props)
            this.props.navigation.navigate('QRscanner')}}
      />

      </View>
    );


}
